import React from 'react';
import './styles.css';

export default function Register() {
  return (
    <div className="register-container">
      <section className="form">
        <form action="">
          <h1>Faça seu login</h1>
          <input type="text" placeholder="Sua ID" />
          <button type="submit" className="button">
            Entrar
          </button>
          <a href="/register">
            Não tenho cadastro
          </a>
        </form>
      </section>
    </div>
  );
};
